        <h2 className="name">Romain Levasseur</h2>
        <span class="computer-svg">
            <ComputerComponent />
        </span>

        <div className="left-panel"></div>
        <div className="right-panel">
            <div class="description">
                {" "}
                <HeroCard />
            </div>
        </div>
    </div>;
};

export default Page1;
